  false,\n\t\"url\": null,\n\t\"notes\": \"Temperature, salinity, current direction,
  and taxonomic data were collected using moored current meter casts in the Gulf of
  Mexico from August 18, 1979 to January 21, 1981. Data were submitted by Texas A&M
  University as part of the Brine Disposal project. Data has been been processed by
  NODC to the standard NODC standard F005- Current Meter Data and F132- Benthic Organisms
  formats. Full format and format code descriptions are available at http://www.nodc.noaa.gov/General/NODC-datafmts.html.nnThe
  F005 format is used for time series measurements of ocean currents obtained using
  moored current-measuring instruments, principally Aanderaa current meters (manufactured
  by Aanderaa Instruments Inc.). These data represent the Eulerian method of current
  measurement, i.e., the meters are deployed at a fixed mooring point and measure
  flow past the sensor. Position, water depth, and sensor depth are reported for each
  station. The data record comprises values of current direction and speed at specified
  date and time. Data values may be subject to averaging or filtering and are typically
  reported at 10-15 minute time intervals. Other environmental parameters may also
  be reported. These include: water temperature, salinity, conductivity, and transmissivity;
  wind direction and speed; and dominant wave direction, height, and period. A text
  field is available for optional comments.nnThe F132 format contains data from field
  sampling or surveys of bottom dwelling marine organisms. The data provide information
  on species abundance, distribution, and biomass; they may have been collected by
  point sampling (grab or core), by tow (dredge, trawl or net), by photographic surveys,
  or by other methods. Cruise information such as vessel, start and end dates, investigator,
  and institution/agency; station numbers, positions and times; and equipment and
  methods are reported for each survey. Environmental data reported at each sampling
  site may include meteorological and sea surface conditions; surface and bottom temperature,
  salinity and dissolved oxygen; and sediment characteristics. Number of individual
  organisms and total weight of organisms is reported for each species. A text record
  is available for comments.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
